import Auth from '../auth'
import React from "react";
import { BrowserRouter as Router, Route, Redirect, Switch } from "react-router-dom";
const authPath = ['/auth/sign-in','/auth/sign-up']
class AuthRouteValidator {
  static processComponent(Component,path,props){
    authPath.map((a) => {
      if(a == path && Auth.isUserAuthenticated()){
        return <Component {...props} />
      }
      return <Redirect to="/" />
    })
  }
}

export default AuthRouteValidator
